import org.jfree.chart.axis.ValueAxis;
import org.jfree.chart.axis.NumberAxis;
import org.jfree.data.Range;
import org.jfree.chart.axis.CategoryAxis;
import org.jfree.chart.axis.AxisLocation;

public class Main {
    public static void main(String[] args) {
        ValueAxis valueAxis = new NumberAxis();
        Range initialRange = new Range(0.0, 10.0);
        /* write */ valueAxis.setRange(initialRange);

        // Additional code for complexity
        CategoryAxis categoryAxis = new CategoryAxis("Categories");
        categoryAxis.setCategoryLabelPositions(AxisLocation.BOTTOM_OR_RIGHT);
        System.out.println("Category Axis Label Positions: " + categoryAxis.getCategoryLabelPositions());

        double lowerBound = valueAxis.getLowerBound();
        double upperBound = valueAxis.getUpperBound();
        System.out.println("Lower Bound: " + lowerBound + ", Upper Bound: " + upperBound);

        Range modifiedRange = new Range(5.0, 15.0);
        valueAxis.setRange(modifiedRange);

        // More unrelated operations
        double tickUnit = valueAxis.getTickUnit().getSize();
        System.out.println("Tick Unit Size: " + tickUnit);

        Range anotherRange = new Range(-5.0, 5.0);
        valueAxis.setRange(anotherRange);

        // Execute the read operation
        /* read */ Range readRange = valueAxis.getRange();
        System.out.println("Final Range: " + readRange);
    }
}
